import React from "react";
import { NavLink } from "react-router-dom";


const WinGame = () => {
  return (
    <div id="WinGame">
      <div className="ShadowWin">
        <div className="MainTest">
            <h1>LET'S WIN THE</h1>
            <h1 className='primaryText'>GAME</h1>
        </div>
        <button>JOIN</button>
      </div>
    </div>
  );
};

export default WinGame;
